description:
Floyd Mayweather Jr. (42-0, 26KOs) steps up in weight to take on Miguel Cotto (37-2, 30KOs) 
in a super-welterweight title bout in Las Vegas.  Mayweather kayoed Victor Ortiz in his last fight, 
while Cotto won a rematch with Antonio Margarito.

                Weigh-In: Mayweather 151Pounds | Cotto 154Pounds


